using Xunit;

namespace StringTokenFormatter.Tests;

public class BigTextTests
{
    [Fact]
    public void Large_Sample_1()
    {
        var sample = @"<p>&nbsp;</p>  <p><span id=""lblText"" class=""RadLabel RadLabel_Default"">{Task.TaskNumber}</span></p>  <p><span id=""lblText"" class=""RadLabel RadLabel_Default"">{Task.TaskCustomer}</span></p>  <p><span id=""lblText"" class=""RadLabel RadLabel_Default"">{Entry.Description}<img alt="""" src=""data:image/jpeg;base64,";

        var parser = InterpolatedStringParsers.Default;

        var actual = parser.Parse(sample).Segments.ToList();
        
        Assert.Equal(7, actual.Count);
    }
}
